import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import './App.css';
import ToDoList from './pages/ToDoList';

function App() {
  return (
    <Router>
      <main>
        <Switch>
          <Route component={ToDoList} path="/" exact />
        </Switch>
      </main>

    </Router>
  );
}

export default App;
